import React from 'react'

const IntTitle = () => {
    return (
        <div className="intTitle">
            <div>뉴스</div>
            <div>쇼핑</div>
            <div>Egg TV</div>
            <div>Egg Board</div>
        </div>
    )
}

export default IntTitle;
